import React from 'react';

function Home() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1>Welcome to Budget Brilliance</h1>
      <p>We provide the best financial products to help you achieve your goals.</p>
    </div>
  );
}

export default Home;
